import './App.css';
import IconColumn from './Components/IconColumn.jsx'
import NavBar from './Components/NavBar.jsx'
import { library } from '@fortawesome/fontawesome-svg-core';
import { fas } from '@fortawesome/free-solid-svg-icons';

library.add(fas);

function App() {
  return (
    <Draggable
        handle=".handle"
        defaultPosition={{x: offSetX, y: offSetY}}
    >
      <div class="flex flex-col h-screen w-screen bg-black font-mono">
        <NavBar />
        <IconColumn />
      </div>
    </Draggable>
  );
}

export default App;
